import logo_1 from './images/logo_1.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from '@mui/material/Button';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useAuth0 } from '@auth0/auth0-react';


const Nav = () => {

      const { user, loginWithReDirect } = useAuth0();

    const theme = createTheme({
        palette: {
            primary: {
            main: '#fbbf24',
            },
            secondary: {
            main: '#fbbf24', 
            },
        },
    });

    return(
        <nav className="navbar navbar-expand-sm navbar-dark bg-dark p-0 mb-5">
            <div className="container">
                
                <a href='/' className='navbar-brand mb-0 h1 pt-3'>
                    <img src={logo_1} alt="Logo" width="40"/>
                        <p>NextBook.</p>
                </a>
            
                <button className="navbar-toggler " type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse nav-collapse" id="navbarNav">                
                    
                    <div className="container d-flex justify-content-center">

                        <ul className="navbar-nav">
                            
                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    Home
                                </a>
                            </li>
                        
                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    About
                                </a>
                            </li>

                            <li className="nav-item">
                                <a href="/" className="nav-link">
                                    Contact
                                </a>
                            </li>
                        
                        </ul>

                    </div>

                        <form action="/" className="d-flex justify-content-center">
                            <ThemeProvider theme={theme}>
                            <Button onClick={ (e) =>  loginWithReDirect() } size='secondary' variant='contained' color="primary" href='/'>SignIn</Button>
                            </ThemeProvider>
                        </form>
                </div>

            </div>

        </nav>
    );
}

export default Nav;
